import React from 'react';

function getHandsigns() {

}

class Handsigns extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            data: false,
            objects: []
        };
    }

    getHandSigns() {
        let url = "https://rps101.pythonanywhere.com/api/v1/objects/all"
        fetch(url)
        .then((response) => {
            return(response.json());
        }) .then((signs) => {
            console.log(signs);
            this.setState({objects:signs});
            console.log(this.state.objects);
        });
    }
}
